class Contact extends Component {

    state = {
        contacts : [
            {num : '+216 1684984'}
        ]
    }

    render (){
        return (
            <div className="row mx-5 my-3">
                <input className="col-auto form-control w-50" /> 
                ;&nbsp
                <input type="button" value='ADD' className="col-auto btn btn-success" />
                <br />
                <h1>Contacts :</h1>
            </div>
        );
    }
}

export default Contact;
